<?php

namespace NFePHP\NFSe\Tests\Common;

use NFePHP\NFSe\Tests\NFSeTestCase;
use NFePHP\Common\Certificate;
use NFePHP\NFSe\Common\Factory;

class FactoryTest  extends NFSeTestCase
{
    public $factory;
    
    public function __construct()
    {
        parent::__construct();
        $this->factory = new Factory(Certificate::readPfx($this->contentpfx, $this->passwordpfx));
    }
    
    public function testPathSchemes()
    {
        $path = $this->factory->pathSchemes.DIRECTORY_SEPARATOR.'Prodam';
        $condition = is_dir($path);
        $this->assertTrue($condition);
    }
    
    public function testClear()
    {
        $text = '<?xml version="1.0" encoding="utf-8"?>';
        $actual = $this->factory->clear($text);
        $expected = "";
        $this->assertEquals($expected, $actual);
    }
    
    public function testSetAlgorithm()
    {
        $expected = OPENSSL_ALGO_SHA256;
        $this->factory->setSignAlgorithm(OPENSSL_ALGO_SHA256);
        $this->assertEquals($expected, $this->factory->algorithm);
    }
    
    public function testValidar()
    {
        //$body = '<PedidoConsultaCNPJ xmlns:xsd="http://www.w3.org/2001/XMLSchema" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xmlns="http://www.prefeitura.sp.gov.br/nfe"><Cabecalho xmlns="" Versao="1"><CPFCNPJRemetente><CNPJ>08894935000170</CNPJ></CPFCNPJRemetente></Cabecalho><CNPJContribuinte xmlns=""><CNPJ>08894935000170</CNPJ></CNPJContribuinte><Signature xmlns="http://www.w3.org/2000/09/xmldsig#"><SignedInfo><CanonicalizationMethod Algorithm="http://www.w3.org/TR/2001/REC-xml-c14n-20010315"/><SignatureMethod Algorithm="http://www.w3.org/2000/09/xmldsig#rsa-sha1"/><Reference URI=""><Transforms><Transform Algorithm="http://www.w3.org/2000/09/xmldsig#enveloped-signature"/><Transform Algorithm="http://www.w3.org/TR/2001/REC-xml-c14n-20010315"/></Transforms><DigestMethod Algorithm="http://www.w3.org/2000/09/xmldsig#sha1"/><DigestValue>hba9T3PJ/pNk/hAq8h91tjifWXA=</DigestValue></Reference></SignedInfo><SignatureValue></SignatureValue><KeyInfo><X509Data><X509Certificate></X509Certificate></X509Data></KeyInfo></Signature></PedidoConsultaCNPJ>';
        //$condition = $this->factory->validar(1, $body, 'Prodam', 'PedidoConsultaCNPJ', 'v');
        $this->assertTrue(true);
    }
    
    /**
     * @expectedException RuntimeException
     */
    public function testValidarXmlFail()
    {
        $versao = 1;
        $body = '<PedidoConsultaCNPJ xmlns:xsd="http://www.w3.org/2001/XMLSchema" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xmlns="http://www.prefeitura.sp.gov.br/nfe"><Cabecalho xmlns="" Versao="1"><CPFCNPJRemetente><CNPJ>08894935000170</CNPJ></CPFCNPJRemetente></Cabecalho><CNPJContribuinte xmlns=""></CNPJContribuinte><Signature xmlns="http://www.w3.org/2000/09/xmldsig#"><SignedInfo><CanonicalizationMethod Algorithm="http://www.w3.org/TR/2001/REC-xml-c14n-20010315"/><SignatureMethod Algorithm="http://www.w3.org/2000/09/xmldsig#rsa-sha1"/><Reference URI=""><Transforms><Transform Algorithm="http://www.w3.org/2000/09/xmldsig#enveloped-signature"/><Transform Algorithm="http://www.w3.org/TR/2001/REC-xml-c14n-20010315"/></Transforms><DigestMethod Algorithm="http://www.w3.org/2000/09/xmldsig#sha1"/><DigestValue>hba9T3PJ/pNk/hAq8h91tjifWXA=</DigestValue></Reference></SignedInfo><SignatureValue></SignatureValue><KeyInfo><X509Data><X509Certificate></X509Certificate></X509Data></KeyInfo></Signature></PedidoConsultaCNPJ>';
        $condition = $this->factory->validar($versao, $body, 'Prodam', 'PedidoConsultaCNPJ', 'v');
    }
    
    /**
     * @expectedException InvalidArgumentException
     */
    public function testValidarXsdFail()
    {
        $versao = 99;
        $body = '<PedidoConsultaCNPJ xmlns:xsd="http://www.w3.org/2001/XMLSchema" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xmlns="http://www.prefeitura.sp.gov.br/nfe"><Cabecalho xmlns="" Versao="1"><CPFCNPJRemetente><CNPJ>08894935000170</CNPJ></CPFCNPJRemetente></Cabecalho><CNPJContribuinte xmlns=""><CNPJ>08894935000170</CNPJ></CNPJContribuinte><Signature xmlns="http://www.w3.org/2000/09/xmldsig#"><SignedInfo><CanonicalizationMethod Algorithm="http://www.w3.org/TR/2001/REC-xml-c14n-20010315"/><SignatureMethod Algorithm="http://www.w3.org/2000/09/xmldsig#rsa-sha1"/><Reference URI=""><Transforms><Transform Algorithm="http://www.w3.org/2000/09/xmldsig#enveloped-signature"/><Transform Algorithm="http://www.w3.org/TR/2001/REC-xml-c14n-20010315"/></Transforms><DigestMethod Algorithm="http://www.w3.org/2000/09/xmldsig#sha1"/><DigestValue>hba9T3PJ/pNk/hAq8h91tjifWXA=</DigestValue></Reference></SignedInfo><SignatureValue></SignatureValue><KeyInfo><X509Data><X509Certificate></X509Certificate></X509Data></KeyInfo></Signature></PedidoConsultaCNPJ>';
        $condition = $this->factory->validar($versao, $body, 'Prodam', 'PedidoConsultaCNPJ', 'v');
    }
}
